import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './styles.scss';

export default class SobreDescricao extends Component {  
    render() {
        return (
            <React.Fragment>
                <section className="sobre">
                    <div className="container-sobre">
                        <h1 className="sobre-titulo">O PlayerStars é o lugar onde duelos épicos acontecem.
Onde o que define o jogo é sua habilidade de vencer.
E onde quem conquista o universo dos games ganha na vida real.
</h1>
                        <div className="div-descricao">
                            <p className="descricao-sobre">Donec vel sagittis odio. Pellentesque libero arcu, pharetra sit amet pretium sed, rutrum et libero.</p>
                            <p className="descricao-sobre">Cras condimentum venenatis facilisis. Curabitur mattis quam quis mi feugiat, ut blandit magna pharetra. Classiti sociosqu ad litora torquent per conubia nostra, inceptos himenaeos. Sed sit amet posuere justo.</p>
                            <p className="descricao-sobre">Pellentesque at vestibulum tellus, vitae hendrerit felis.</p>
                            <p className="descricao-sobre">Quisque blandit ipsum sit amet urna viverra convallis. Classiti sociosqu ad litora torquent per conubia nostra, inceptos himenaeos. Sed sit amet posuere justo.</p>
                            <p className="descricao-sobre">Quisque blandit ipsum sit amet urna viverra convallis. Classiti sociosqu ad litora torquent per conubia nostra, inceptos himenaeos. Sed sit amet posuere justo.</p>
                            <Link to="/cadastro"><button className="btn-participe">Quero ser um PlayerStars</button></Link>
                        </div>
                    </div>
                </section>
            </React.Fragment>
        )
    }
}
